public static Trilean getTrilean(String str) {
  if (TRUE_STR.equalsIgnoreCase(str)) {
    return Trilean.TRUE;
  }

  if (FALSE_STR.equalsIgnoreCase(str)) {
    return Trilean.FALSE;
  }

  return Trilean.UNKNOWN;
}
